description:
Rejoignez une société en pleine croissance en tant que développeur web !
Restofuté recherche un développeur web full-stack, ayant des compétences avancées en développement back-end (PHP7 / Mysql), et front-end (HTML5 / CSS3 / et Javascript / jQuery). Le poste proposé est un CDI à temps plein et à pourvoir pour le mois d’octobre 2019.
Notre société dispose de locaux situés en plein centre ville de Toulouse (Place Wilson) qui vous fournissent un cadre de travail agréable et stimulant, dans une société en pleine croissance.
Le candidat(e) recherché(e) doit :

être curieux sur l’évolution de son métier de développeur ;
avoir l’envie d’apprendre le bases d’autres métiers liés au digital (webmarketing, community management, …) ;
savoir comprendre, analyser et interpréter les besoins de la société ;
communiquer de façon claire et précise avec les autres membres de l’équipe ;
réaliser une veille technique.

Compétences et connaissances requises :

des références significatives en développement web (logiciel, site Internet) ;
Une maîtrise avancée de PHP7 et la POO (pas de frameworks) ;
Une bonne maîtrise du SQL (MySQL)
Une bonne connaissance de HTML, CSS et Javascript (+ jQuery) ;
Des notions en framework javascript (Angular) seraient un plus pour des développements futurs ;
Savoir s’intégrer dans un projet déjà existant, et en développement depuis plusieurs années ;
Savoir produire un code de qualité, bien commenté et lisible ;
Des connaissances en PWA et WordPress seraient appréciables ;
Une bonne sensibilité graphique et ergonomique ;

Vous travaillerez en équipe avec le développeur actuel le temps de vous former sur l’outil de travail (2 à 3 mois), puis en autonomie à partir de Janvier 2020.
Contactez-nous au 06.37.48.53.31 ou par email à camille@restofute.com.

/***
* Le groupe Sporting recrute pour son agence de communication Sporting Comm’
* une rock star ou un ninja Web Full Stack (H/F)
**/
# TODO
Rattaché(e) au responsable développement, votre mission principale consistera à développer, maintenir et faire évoluer le parc existant et prendre le contrôle de l'interwebz. Vos autres occupations seront :
l'intégration de site (connaissance des microdatas : SEO), d’e-mailing, newsletters et de landings - Desktop et Responsive – le repos du guerrier ;
le développement de sites, d’application métier – le cœur du job ;
la rédaction de documentation (spécifications techniques, cahiers des charges, documentation utilisateur) – le bonheur ;
votre recettage et votre contrôle qualité – rien de méchant.
critiquer les pistes musicales du jour
# function()
Nous attendons un coder capable de plein de choses, mais surtout ayant envie de progresser. Voilà un aperçu des méthodes les plus importantes :
maîtrise de l'Elephant bleu en version 7, de Javascript-qui-n-est-pas-un-langage et de l'héxagone vert et de son lot de dépendances ;
côté DB on utilise le Dauphin, l'Otarie et l'Autre Eléphant à grosse tête ;
nager quotidiennement dans le W3C ;
intégrer pour %whateverDeviceSize% ;
connaissance d’un ou plusieurs framework JS et des APIs Google appréciée ;
être capable d'installer une extension au format .SO et jouer avec 'rm -rf' sans casser la prod.
# Profil
Au-délà d'un fort second degré, d'une énorme capacité à seconder les autres grâce à vos compétences hors du commun et de votre empathie sans limite :
yourExp >= 6,307e+7s ;
vous savez ce qu'est un bug bounty et PEP8, même si vous faites du PHP ;
très bonne connaissance en modélisation de données, proprement ;
WordPress ou Drupal ont retenu toute votre attention (mais pas Joomla) ;
vous complotez régulièrement pour conquérir le monde ;
vous êtes polyvalent(e) et vous faites preuve d’initiative, vous êtes organisé(e), impliqué(e) et réactif(ve). Bref, vous êtes brillant(e), parfait(e).
# .env
poste en boucle avec break conditionnel ;
poste en CDI ;
rémunération selon profil : de 26 à 30 k€ ;
avantages : abonnement salle de sport à Sporting Form offert, accès au SPA offert, mutuelle entreprise, tarif réduit au restaurant Sporting Eat mais surtout du café ;
Ho ! Et le restau à un baby-foot ! Un baby-foot !
Type d'emploi : CDI
Salaire : 26 000,00€ à 30 000,00€ /an
Expérience:
développeur web full stack h/f ou similaire: 1 an (Requis)

Rejoignez une société en pleine croissance en tant que développeur web !
Restofuté recherche un développeur web full-stack, ayant des compétences avancées en développement back-end (PHP7 / Mysql), et front-end (HTML5 / CSS3 / et Javascript / jQuery). Le poste proposé est un CDI à temps plein et à pourvoir pour mi-octobre 2019.
Le poste ce scinde en deux missions principales :
La mise à jour, le développement de nouveaux modules et de nouveaux projets autour du logiciel Restofuté ;
La mise en place et la maintenance d'un projet E-Commerce basé sur Prestashop.
Notre société dispose de locaux situés en plein centre ville de Toulouse (Place Wilson) qui vous fournissent un cadre de travail agréable et stimulant, dans une société en pleine croissance.
Le candidat(e) recherché(e) doit :
être curieux sur l’évolution de son métier de développeur ;
avoir l’envie d’apprendre le bases d’autres métiers liés au digital (webmarketing, community management, …) ;
savoir comprendre, analyser et interpréter les besoins de la société ;
communiquer de façon claire et précise avec les autres membres de l’équipe ;
réaliser une veille technique.
Compétences et connaissances requises :
des références significatives en développement web (logiciel, site Internet) ;
Une maîtrise avancée de PHP7 et la POO ;
Une bonne maîtrise du SQL (MySQL)
Une bonne connaissance de HTML, CSS et Javascript (+ jQuery) ;
Une première expérience de développement sur Prestashop
Des notions en framework javascript (Angular) seraient un plus pour des développements futurs ;
Savoir s’intégrer dans un projet déjà existant, et en développement depuis plusieurs années ;
Savoir produire un code de qualité, bien commenté et lisible ;
Des connaissances en PWA et WordPress seraient appréciables ;
Une bonne sensibilité graphique et ergonomique ;
Vous travaillerez pendant 2 mois avec le développeur actuel le temps de vous former sur les différents projets, puis en autonomie à partir de Janvier 2020.
Type d'emploi : Temps plein, CDI
Salaire : 25 000,00€ à 30 000,00€ /an
Expérience:
développeur web php h/f ou similaire: 1 an (Souhaité)

Au sein de notre Digital Factory JUMP, vous serez en charge de piloter et d’assurer la mise en place de plusieurs projets de création ou déclinaison de solutions de Learning digitales : plateformes web, modules e-learning, vidéos acteur ou motion, simulateurs interactifs, applications mobiles, mini-games...

A ce titre, vous :
Accompagnez nos clients dans la construction d’outils digitaux de formation qui vont aider à monter en compétences leurs collaborateurs ; vous les aiderez ainsi à formuler au mieux leurs besoins, dans le respect de leurs contraintes techniques, délais et budget ;

Rédigez les documents projet (comptes-rendus et reporting, Spécifications Fonctionnelles Détaillées) et créez des maquettes graphiques & fonctionnelles dans le respect de notre ligne directrice en termes de UX et de design ;

Pilotez la réalisation des projets en coordination directe avec notre usine digitale, JUMP (développeurs, motion-designers, graphistes…) et avec des responsables pédagogiques (experts en contenu) ;

Assurez la phase de recette interne et organisez les recettes client ;

Suivez l’avancement, le budget et les vigilances ;

Assurez le reporting interne et externe ;

Organisez des réunions/audios projet régulières internes et externes. Vous serez l’interlocuteur privilégié de nos clients sur le périmètre digital ;

Gérer le planning et le suivi budgétaire pour chacun des projets confiés

Participez à des événements prospects ou clients en tant qu’expert des outils développés par notre Groupe ;

Communiquez sur le bon déroulement du projet permettant ainsi au client de comprendre l’état d’avancement de son projet et avoir une vision sur les prochaines étapes ;

Ponctuellement, participez à des missions transverses au sein de notre société, comme la mise en place de nouveaux outils
Profil recherché De formation Bac +5 de type universitaire, ou Ecole de Commerce, vous avez une expérience professionnelle confirmée de 2 années minimum, ou une première expérience significative sur un poste similaire, et idéalement une expérience dans les métiers du WEBet du digital dans le domaine du conseil et/ou de la formation.

Vous avez de solides connaissances des cycles de production et des outils de gestion de projet ainsi que dans la gestion de projets Agiles et Cycle en V. Vous appréciez le conseil client, et êtes à l’aise dans un environnement technique et client.
Entreprise BIZNESS est le n°1 de la Formation Nouvelle Génération, Créé en 2007 à Toulouse.

Notre marque a pour ambition de dépoussiérer le monde la formation professionnelle. Nous ne formons plus aujourd’hui comme hier, nous répondons à cette réalité en créant une expérience unique. A travers nos mix pédagogiques et des technologies innovantes, nos concepts sont véhiculés par des outils d’apprentissage et d’entrainement uniques.

Dans le cadre d’une création de poste, le Groupe BIZNESS recrute un/une un/une Ingénieur Digital, Chef de Projets sur nos dispositifs digitaux de notre Digital Factory Jump, au sein de sa direction de la Production Client!

TECH VALLEY est une société de Consulting en Systèmes d’Informations, et d’Expertise en ingénierie informatique, constituée d’une équipe de consultants, d’ingénieurs, et d’experts.
Nous mettons en avant une vision fédératrice de la qualité des SI : robustesse, efficacité, dimensionnement, sécurité, performance, évolutivité, conformité, optimisation.
Nous intervenons au national dans l’accompagnement des Grands Comptes et des ETI secteurs industrie, médical, telecom, finance, énergie, sur la transition de l’industrialisation des systèmes d’informations, principalement sur les architectures fonctionnelles, les process de développement et intégration, la Qualité et sécurité des systèmes d’informations, la fiabilité et les performances, ainsi que sur les architectures techniques et opérationnelles, les process de production et changement.
Le siège de la société se situe à Perpignan Tecnosud, nos agences couvrent nos interventions à Toulouse, Bordeaux, Nantes, Lille, Paris, Lyon, Montpellier, Aix, Sophia Antipolis.

Intitulé du poste : consultant JAVA JEE

Site : Toulouse

Postes ouverts au recrutement :
. Concepteur-développeur
. Lead developer
. Architecte applicatif

Vos compétences techniques :
. Java, Jee ;
. Struts, Spring, JSF, Jhipster, ou équivalent ;
. Hibernate ;
. Eclipse, netbeans, ou équivalent,
. web services, XML, Api Rest ;
. Javascript, HTML5 et CSS ; Angular, Bootstrap ;
. Maven, Hudson, Jenkins, ou équivalent ;
. Sonar apprécié, SVN, GIT, ou équivalent ;
. Apache, Tomcat, Websphere, Jboss, ou équivalent ;
. Apprécié : Selenium, Junit, SoapUI

Votre expérience, votre sens du service, votre goût du travail en équipe et vos qualités relationnelles font partie de vos atouts, rejoignez la team TECH VALLEY !

TECH VALLEY - Consultants en Systèmes et Technologies de l’Information - France

Toulouse, France
À propos
La société Anakeen a pour objectif d’apporter une plus grande efficacité aux entreprises dans leur démarche de transformation digitale en les aidant à réaliser des applications web et mobiles adaptées et ce plus rapidement grâce à une plateforme de développement rapide (Low-Code) : Anakeen Platform.
Ce que vous trouverez :
Travail dans un environnement dynamique et agréable (région toulousaine – Colomiers) ;
Interaction avec l’ensemble des service de l’entreprise (marketing, commerce, R&D) ;
PME en pleine croissance avec des opportunités d’évolution de poste ;
Équipes aux profils diversifiés et complémentaires ;
Une société avec des valeurs humaines et environnementales .
Descriptif du poste :
En binôme avec un consultant fonctionnel, vous développez des solutions sur-mesure pour les clients. Vous êtes accompagné de nos développeurs seniors, et par l’équipe R&D pour apporter la meilleure réponse aux problématiques du client.
Vous intervenez de la conception à la mise en production des projets. Responsable de ce que vous produisez, vous avez une vision et une implication globales sur ces projets.
Soucieux de suivre les évolutions des technologies, nous sommes amenés à utiliser de nouveaux outils et à impliquer chacun dans l’utilisation de ces outils. Vous acceptez continuellement de remettre en question vos outils et méthodes pour découvrir et vous approprier ces nouvelles solutions.
Chaque projet est l’opportunité de répondre à des besoins nouveaux, et de découvrir de nouveaux environnements.
Périmètre principal que pourront couvrir vos responsabilités :
Développement
Conception de solutions techniques appropriées
Mise en œuvre de ces solutions ;
Réalisation de Proof of Concept en phase d’avant-vente ;
Recherche et développement
Benchmark et évaluation de solutions
Proposition de nouvelles solutions ;
Accompagnement des intégrateurs / développeurs dans l’utilisation du produit ;
Maintenance.
Profil recherché :
Cocher des cases et mettre les candidats dans des boîtes, ce n’est pas notre credo. Cependant des compétences socles sont nécessaires pour s’épanouir dans ce poste.
Compétences et expériences dans l’idéal :
Autonome, créatif, curieux et motivé ;
Maîtrise des technologies front et back ;
Les technologies actuelles sont PHP, javascript et postgreSQL, mais pourront évoluer ;
Connaissance des environnements de développement (git) ;
Forte capacité d’adaptation ;
Bonne connaissance du système d’exploitation Linux ;
Bac +3/+5, formation théorique et pratique en informatique.
Salaire et avantages :
Salaire fixe selon profil ;
Prime de fin d’année entre 2 et 5 K euros ;
Mutuelle de haut niveau de couverture ;
Prime de vacances (selon convention SYNTEC) ;
Télétravail possible (1 à 2 jours par semaine) .
Déroulement des entretiens:
4 étapes :
Dépôt CV, réponse rapide et systématique ;
1 entretien par visio ou téléphonique ;
1 entretien sur le site à Toulouse ou au siège de Paris ;
Signature du contrat en CDI.

